import React, { Component } from "react";
import { FormGroup, Col, Input } from "reactstrap";
import { OptionsModal } from "./OptionsModal";

class GeneratorColumnInput extends Component {
  constructor(props) {
    super(props);
    this.onModalChange = this.onModalChange.bind(this);
    this.state = {
      dataType: "",
      numCols: "",
      modalOptions: {
        option1: "",
        option2: "",
        option3: ""
      }
    };
  }

  onModalChange(opt1, opt2, opt3) {
    let modalOptions = Object.assign({}, this.state.modalOptions);
    modalOptions.option1 = opt1;
    modalOptions.option2 = opt2;
    modalOptions.option3 = opt3;
    console.log(opt1);
    console.log(modalOptions);
    this.setState({ modalOptions });
    console.log(this.state.modalOptions);
  }

  render() {
    return (
      <FormGroup row>
        <Col md={3}>
          <Input
            type="select"
            name="datatype"
            id={`type-${this.props.id}`}
            onChange={e => this.setState({ dataType: e.target.value })}
          >
            <option value="integer">Integer</option>
            <option value="time-series">Time-Series</option>
            <option value="email">Email</option>
            <option value="phone">Phone Number</option>
          </Input>
        </Col>
        <Col md={3}>
          <Input
            type="number"
            name="numcols"
            id={`numcols-${this.props.id}`}
            onChange={e => this.setState({ numCols: e.target.value })}
          />
        </Col>
        <Col md={2}>
          <OptionsModal
            type={this.state.dataType}
            onModalChange={this.onModalChange}
          />
        </Col>
      </FormGroup>
    );
  }
}

export { GeneratorColumnInput as GeneratorInput };
